import React from "react";
import GraphData from "./graphData";

export default function ChartAdmin(){
  return(
    <div className="container">
      <GraphData income={30} expense={22}/>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          marginBottom: "20px",
        }}
      >
      </div>
    </div>
  )
}
